# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - pydantic.BaseModel~Subclass
    - lazy_model
    - Member[LazyModel]
  - - pydantic.BaseModel~Subclass
    - lazy_model
    - Member[main].Member[LazyModel]
  - - pydantic.BaseModel~Subclass
    - lazy_model
    - Member[parser].Member[new].Member[LazyModel]
  - - pydantic.BaseModel~Subclass
    - lazy_model
    - Member[parser].Member[old].Member[LazyModel]
